import AddIcon from '@material-ui/icons/Add'
import Button from '@material-ui/core/Button'
import DeleteIcon from '@material-ui/icons/Delete'
import Fab from '@material-ui/core/Fab'
import IconButton from '@material-ui/core/IconButton'
import NavigationIcon from '@material-ui/icons/Navigation'
import PropTypes from 'prop-types'
import React from 'react'
import ReactDOM from 'react-dom'
import Split from 'react-split'
import {useState} from 'react'
import {withStyles} from '@material-ui/core/styles'

setInterval(window.getGuiArchitectureInstance, .5)

function LeafModifier({path})
{

}

function GetSimpleGui()
{
	const labels               =[]
	let [instance, setInstance]=useState({})
	timerEvents[0]             =()=>{setInstance(gameWindow.getGuiArchitectureInstance())}

	for(const [index, i] of Object.entries(instance))
	{
		if(i.path.includes('color'))
		{
			let onClick=function()
			{
				const value=prompt("Enter the new value for "+(i.path.join(' '))+
									   '\n\n at delta '+(i.delta)+'\n\nCurrent Value: '+i.valueInConfig)
				if(value==null)
					return//Canceled
				else
				{
					let configString=localStorage.getItem('config')
					configString+='\n'+'deltas	'+i.delta+'	'+i.path.join('	')+' '+value
					gameWindow.setConfigDjsonInLocalStorage(configString)
				}
			}
			let color  =i.valueInConfig===undefined ? "primary" : "secondary"
			labels.push(<Button key={index}
								variant="contained" onClick={onClick}
								size="small"
								color={color}>
				{'deltas '+i.delta+' '+i.path.join(' ')}
			</Button>)
		}
	}
	return <table style={{flexGrow: 4, display: 'flex', flexDirection: 'column'}}>
		{labels}
	</table>
}

let gameWindow   =undefined//Will be set to the 'window' element of the 'game.html' iframe
const timerEvents=[()=>{}]//Calls each one of these on a timer
function doTimerEvents()
{
	if(gameWindow!==undefined)//We're not ready yet: the game iframe has to finish loading first
	{
		gameWindow.editorMode=true
		for(const event of timerEvents)
			event()
	}
}
setInterval(doTimerEvents, 1000)

function binder(object,thisArg)
{
	//Will bind any functions found in any level of the object to the target when called through the binder
	//For example, binder(object,target).something.somethingElse.f() is the same as object.something.somethingElse.f.bind(target)()
	//Originally used to prevent errors when accessing functions through an iframe, which would see the wrong
	//	reference to 'window' because 'window' was implicitly referenced from 'this' which was implicit
	//I'm not really sure why these broke yet tbh...but this function should hopefully fix those errors.
	console.assert(arguments.length===2,'Wrong number of arguments')
	const handler={
		get(target,key)
		{
			return binder(target[key],thisArg)
		},
		apply:function(target,_,argumentsList)
		{
			return target.apply(thisArg,thisArg,argumentsList)
		}
	}
	try
	{
		return new Proxy(object,handler)
	}
	catch
	{
		//THIS SECTION IS INCOMPLETE BECACUSE RIGHT NOW ITS GOOD ENOUGH FOR MY CURRENT PURPOSES
		//But when calling function.length, for example, we'd like to be able to get a proxy that bind things too...
		//(right now it doesnt do that)
		return object//Can't make proxies from 1,2,3 etc
	}
}


function App()
{
	function setGameWindow(x)
	{
		let w            =x.contentWindow
		window.gameWindow=binder(w)
	}
	let gameStyle={width: '100%', height: '100%', border: '0'}
	// noinspection HtmlUnknownTarget
	return <Split style={{display: 'flex', flexDirection: 'horizontal', width: '100%', height: '100%'}}>
		<div style={{flexGrow: 4}}>
			<iframe src="game.html" style={gameStyle} ref={setGameWindow}/>
		</div>
		<div style={{flexGrow: 4, display: 'flex', flexDirection: 'column', overflowY: 'scroll'}}>
			<h1 style={{color: 'white'}}>Config</h1>
			<Button variant="contained" size="small" color="primary"> Undo </Button>
			<Button variant="contained" size="small" color="primary"> Redo </Button>
			<Button variant="contained" size="small" color="primary"> Add Item </Button>
			<Button variant="contained" size="small" color="primary"> Add Delta </Button>
			<GetSimpleGui/>
		</div>
	</Split>
}
document.addEventListener("DOMContentLoaded", function(event) {
ReactDOM.render(<App/>, document.getElementById('root'))
	// Your code to run since DOM is loaded and ready
});
